void mainImage(out mediump vec4 fragColor, in vec2 fragCoord )
{   float widthAspect = iResolution.x/iResolution.y;
 	float xOffset = (1.5 - widthAspect)/2.;

 	//put 0,0 in upper left of a 3:2 box centered in the canvas
    vec2 uv = vec2(xOffset, 1.) + vec2(widthAspect, -1)
        	*fragCoord.xy/iResolution.xy;

 	//eventual goal is to support a proper indexed pallete, but this'll do
    const vec3 low = vec3(40./255., 25./255., 11./255.);
    const vec3 mid = vec3(207./255., 97./255., 42./255.);
    const vec3 high = vec3(251./255., 222./255., 130./255.);
    float weight = (normSample(uv));

 	//I should have simply plotted these as texels in the backbuffer and let
	//the texture sampler filter take care of this
 	const float midpoint = 7./15.;   
 	if(weight < midpoint) {
        fragColor = vec4(mix(low, mid, vec3(1./midpoint*weight)),1.0);
    } else {
        fragColor = vec4(mix(mid, high, vec3(1./(1.-midpoint)*(weight-midpoint))),1.0);
    }

 	//do something timebased instead of just a static image
    float colorFactor = clamp(sin(iTime*3.14159*0.125) + 0.5,0.,1. );
  	fragColor = vec4(mix(fragColor.xyz, vec3(weight), vec3(colorFactor)), 1.0);

 	//mask off artifacts
    fragColor = mix(fragColor, vec4(0.), 1.0 - step(0.,uv.x));
    fragColor = mix(fragColor, vec4(0.), step(1.5,uv.x));
}

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{

   	if (fragCoord.x > 384. || (fragCoord.y) > 256.) {
    	discard;
        return;
    }

    int dataIndex = int((fragCoord.x+192.)/16. + (fragCoord.y*24.));
    int dataGroup = dataIndex/16;


    ivec2 dataLoc = ivec2(dataGroup, dataIndex % 16);
    vec2 uvSource = (vec2(dataLoc))/iResolution.xy;

    vec4 dataSample = texture(iChannel1, uvSource);

    uint[2] data = uint[2](packUnorm2x16(dataSample.xy), packUnorm2x16(dataSample.zw));

    int which = int(fragCoord.x / 8.) & 1;

    uint dWord = data[which];

    int hexOffset = 4 * (7 - int(fragCoord.x) & 7);

    uint val = (dWord >> uint(hexOffset)) & 15u;

	fragColor = vec4(float(val)/15.);

}
